import type { Tune } from "./Tune";
/**
 * The list tunes response.
 */
export type ListTunesResponse = {
    /**
     * List of tunes.
     */
    data: Array<Tune>;
    /**
     * True if it has more items than the returned list.
     */
    has_more: boolean;
    /**
     * Total number of tunes.
     */
    total: number;
};
